import React from 'react';
export class Create extends React.Component {//Returns below text when called
    constructor() {
        super();
        this.onSubmit=this.onSubmit.bind(this);
        this.onChangeTitle=this.onChangeTitle.bind(this);
        this.onChangeTitle=this.onChangeTitle.bind(this);
        this.state = {
            Title: '',
            Year: '',
            Poster: '',
        }

    }
    onChangeTitle(e){
        this.setState({
            Title:e.target.value
        })
    }
    onChangeYear(e){
        this.setState({
            Year:e.target.value
        })
    }
    onSubmit(e){
        e.preventDefault();
    }
    render() {
        return (
            <div className='App'>
                <form onSubmit={this.onSubmit}>
                <div className='form-group'>
                    <label>Add Movie Title</label>
                    <input type='text' className='form-control' value={this.state.Title} onChange={this.onChangeTitle}></input>
                    <label>Add Movie Year</label>
                    <input type='text' className='form-control' value={this.state.Title} onChange={this.onChangeYear}></input>
                </div>
                </form>
                
            </div>
        );
    }
}
